import React from 'react';
import image from '../assets/1.jpg';
import Grid from "@material-ui/core/es/Grid/Grid";
import Card from "@material-ui/core/es/Card/Card";
import CardHeader from "@material-ui/core/es/CardHeader/CardHeader";
import Button from "@material-ui/core/es/Button/Button";
import InputAdornment from "@material-ui/core/es/InputAdornment/InputAdornment";
import Email from "@material-ui/icons/esm/Email";
import Icon from "@material-ui/core/es/Icon/Icon";


function App() {
  return (
      <div>
          <div style={{
              backgroundImage : "url("+ image+")",
              backgroundSize: "cover",
              backgroundPosition: "top center",
              minHeight:'100vh',
              height: "auto"}}>
              <Grid
                  container
                  direction="row"
                  justify="flex-end"
                  alignItems="center">
                  <GridItem xs={12} sm={12} md={4}>
                      <Card>
                          <form >
                              <CardHeader color="primary" >
                                  <h4>Login</h4>
                                  <div >
                                      <Button
                                          justIcon
                                          href="#pablo"
                                          target="_blank"
                                          color="transparent"
                                          onClick={e => e.preventDefault()}
                                      >
                                          <i className={"fab fa-twitter"} />
                                      </Button>
                                      <Button
                                          justIcon
                                          href="#pablo"
                                          target="_blank"
                                          color="transparent"
                                          onClick={e => e.preventDefault()}
                                      >
                                          <i className={"fab fa-facebook"} />
                                      </Button>
                                      <Button
                                          justIcon
                                          href="#pablo"
                                          target="_blank"
                                          color="transparent"
                                          onClick={e => e.preventDefault()}
                                      >
                                          <i className={"fab fa-google-plus-g"} />
                                      </Button>
                                  </div>
                              </CardHeader>
                              <p >Or Be Classical</p>
                              <CardBody>
                                  <CustomInput
                                      labelText="First Name..."
                                      id="first"
                                      formControlProps={{
                                          fullWidth: true
                                      }}
                                      inputProps={{
                                          type: "text",
                                          endAdornment: (
                                              <InputAdornment position="end">
                                                  <People  />
                                              </InputAdornment>
                                          )
                                      }}
                                  />
                                  <CustomInput
                                      labelText="Email..."
                                      id="email"
                                      formControlProps={{
                                          fullWidth: true
                                      }}
                                      inputProps={{
                                          type: "email",
                                          endAdornment: (
                                              <InputAdornment position="end">
                                                  <Email  />
                                              </InputAdornment>
                                          )
                                      }}
                                  />
                                  <CustomInput
                                      labelText="Password"
                                      id="pass"
                                      formControlProps={{
                                          fullWidth: true
                                      }}
                                      inputProps={{
                                          type: "password",
                                          endAdornment: (
                                              <InputAdornment position="end">
                                                  <Icon >
                                                      lock_outline
                                                  </Icon>
                                              </InputAdornment>
                                          ),
                                          autoComplete: "off"
                                      }}
                                  />
                              </CardBody>
                              <CardFooter>
                                  <Button simple color="primary" size="lg">
                                      Get started
                                  </Button>
                              </CardFooter>
                          </form>
                      </Card>
                  </GridItem>

              </Grid>
          </div>
      </div>
  );
}

export default App;
